import React, { useEffect, useState } from "react";
import {
  FaMoneyBillWave,
  FaChartLine,
  FaCashRegister,
  FaPercentage,
  FaChartPie,
} from "react-icons/fa";
import { getCash } from "../api/CashApi";
import {
  calculateInitialCash,
  calculateAvailableCash,
  calculateNetPL,
  calculateCashBalance,
  calculateROI,
} from "./CashCalc";

const Cash = () => {
  const [cashData, setCashData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchCashData = async () => {
      try {
        const data = await getCash();
        setCashData(data);
        console.log(data);
      } catch (error) {
        setError("Error fetching cash data");
        console.error("Error fetching cash data:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchCashData();
  }, []);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>{error}</p>;

  // Use the calculations
  const initialCash = calculateInitialCash(cashData?.initial_cash);
  const netPL = calculateNetPL(cashData?.trades || []);
  const availableCash = calculateAvailableCash(
    initialCash,
    cashData?.trades || []
  );
  const cashBalance = calculateCashBalance(initialCash, netPL);
  const roi = calculateROI(initialCash, netPL);

  return (
    <div className="cash-container">
      <div className="cash-card-container">
        {/* Initial Cash Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaCashRegister className="card-icon" />
            <span className="label">Initial Cash:</span>
            <span className="value">{`$${initialCash.toFixed(2)}`}</span>
          </div>
        </div>

        {/* Available Cash Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaChartPie className="card-icon" />
            <span className="label">Available Cash:</span>
            <span className="value">{`$${availableCash.toFixed(2)}`}</span>
          </div>
        </div>

        {/* Net P/L Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaChartLine className="card-icon" />
            <span className="label">Net P/L:</span>
            <span className="value">{`$${netPL.toFixed(2)}`}</span>
          </div>
        </div>

        {/* Cash Balance Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaMoneyBillWave className="card-icon" />
            <span className="label">Cash Balance:</span>
            <span className="value">{`$${cashBalance.toFixed(2)}`}</span>
          </div>
        </div>

        {/* RoI Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaPercentage className="card-icon" />
            <span className="label">RoI:</span>
            <span className="value">{`${roi.toFixed(2)}%`}</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Cash;

